import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { apiUrl } from "../axios";
import { jwtDecode } from "jwt-decode";

export default function Login() {
  const navigate = useNavigate();
  const [formValues, setFormValues] = useState({});
  const [formError, setFormError] = useState("");

  const onChangeHandler = (e) => {
    setFormValues({ ...formValues, [e.target.name]: e.target.value });
  };

  const onSubmit = (e) => {
    e.preventDefault();
    axios
      .post(apiUrl + "/api/token/", formValues)
      .then((response) => {
        sessionStorage.setItem("access_token", response.data.access);
        sessionStorage.setItem("refresh_token", response.data.refresh);
        
        const user = jwtDecode(response.data.access); // Decode the token
        const userId = user.user_id; // Get user ID
        const username = user.name; // Get username

        // Store user information in session storage
        sessionStorage.setItem("user_id", userId);
        sessionStorage.setItem("name", username);

        // Navigate to a default page after login
        navigate("/home"); // Adjust this to the default page for all users
      })
      .catch((error) => {
        if (error.response && error.response.status === 401) {
          setFormError(error.response.data.detail);
        }
      });
  };

  return (
    <div
      style={{
        height: "100vh",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        background: "linear-gradient(135deg, #f5f7fa, #c3cfe2)", // Creative background gradient
      }}
    >
      <div
        className="container mt-5"
        style={{
          width: "550px", // Increased width for a broader layout
          height: "auto",
          boxShadow: "4px 4px 15px rgba(0, 0, 0, 0.2)", // Softer box shadow
          backgroundColor: "#ffffff", // White background for a cleaner look
          padding: "40px",
          borderRadius: "15px", // Rounded corners for a modern look
          border: "2px solid #007bff", // Add a border to align with the text
        }}
      >
        <form onSubmit={onSubmit} method="post" className="form">
          <div className="row mt-3 mb-3">
            <h2 className="text-center" style={{ fontSize: "30px", color: "#007bff" }}>
              <i className="bi bi-person-circle px-3"></i>Login
            </h2>
          </div>
          <div className="row mb-3">
            <div className="col">
              <label htmlFor="" className="form-label" style={{ fontSize: "18px", color: "#333" }}>
                Username
              </label>
              <input
                type="text"
                name="username"
                placeholder="Enter your username"
                className="form-control"
                style={{
                  fontSize: "16px",
                  padding: "20px",
                  border: "1px solid #ccc",
                  borderRadius: "8px", // Rounded input borders
                }}
                onChange={onChangeHandler}
              />
            </div>
          </div>
          <div className="row mb-3">
            <div className="col">
              <label htmlFor="" className="form-label" style={{ fontSize: "18px", color: "#333" }}>
                Password
              </label>
              <input
                type="password"
                name="password"
                placeholder="Enter your password"
                className="form-control"
                style={{
                  fontSize: "16px",
                  padding: "10px",
                  border: "1px solid #ccc",
                  borderRadius: "8px",
                }}
                onChange={onChangeHandler}
              />
            </div>
          </div>
          <p className="text-danger" style={{ fontSize: "14px" }}>{formError}</p>
          <p style={{ fontSize: "14px", textAlign: "center" }}>
            New User? <a href="register" style={{ color: "#007bff", textDecoration: "none" }}>Register here</a>
          </p>
          <div className="row mb-3">
            <div className="col text-center">
              <button
                className="btn btn-dark"
                style={{
                  width: "100%",
                  fontSize: "18px",
                  padding: "10px 20px",
                  backgroundColor: "#007bff",
                  border: "none",
                  borderRadius: "8px",
                }}
              >
                Login
              </button>
            </div>
          </div>
        </form>
      </div>
    </div>
  );
}
